import React, { Component } from 'react';
import Carousel from 'react-bootstrap/Carousel'
import AddPlaylist from './img/addplaylist.png';
import AddSong from './img/addsong.png';
import ViewAll from './img/viewall.png';
import Welcome from './img/welcome.png';
import ViewPlaylist from './img/viewplaylist.png';
import Index from './img/index.png';

const Project=(props)=>{
        return (
    <div className='carousel'>
    <Carousel>
        <Carousel.Item>
            <img
            className="d-block w-100"
            src={Index}
            alt="First slide"
            />

        </Carousel.Item>
        <Carousel.Item>
            <img
            id="image1"
            className="d-block w-100"
            src={Welcome}
            alt="Third slide"
            />


        </Carousel.Item>
        <Carousel.Item>
            <img
            className="d-block w-100"
            src={AddSong}
            alt="Third slide"
            />


        </Carousel.Item>
        <Carousel.Item>
            <img
            className="d-block w-100"
            src={AddPlaylist}
            alt="Third slide"
            />


        </Carousel.Item>
        <Carousel.Item>
            <img
            className="d-block w-100"
            src={ViewAll}
            alt="Third slide"
            />


        </Carousel.Item>
        <Carousel.Item>
            <img
            className="d-block w-100"
            src={ViewPlaylist}
            alt="Third slide"
            />


        </Carousel.Item>
        </Carousel></div>
        );
    }
export default Project;
